import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common';

import { TableSearchFilterModule } from '../../Pipes/table-search-filter.module';

import { LoaderModule } from '../Shared/loader/loader.module';
import { SubjectMasterComponent } from './subject-master.component';
const routes: Routes = [
  {
    path: '',
    component: SubjectMasterComponent
  }
];

@NgModule({
  declarations: [
    SubjectMasterComponent

  ],

  imports: [RouterModule.forChild(routes), FormsModule, ReactiveFormsModule, CommonModule, TableSearchFilterModule, LoaderModule],
  exports: [RouterModule],
})


export class SubjectMasterRoutingModule { }
